import React from "react";

class Bouton extends React.Component {

    render(){

        const classBtn = ` btn btn-${this.props.couleur} `

        return(
            <button type={this.props.type} className={classBtn} onClick={this.props.submitMessage}> {this.props.children} </button>
        )
    }
}


export default Bouton
